import React from "react";
import '../../common/app.css';

export default class Dropdown extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            display: false,
            content: [],
        }
    }

    render() {
        const user = JSON.parse(localStorage.getItem("user"));

        return(
            <div className="flex dropdown flex-center-align secondary">
                <p className="dropdown-title">
                    {user.username}
                </p>
                <div className="dropdown-content-container width-fit-content">
                    <div className="dropdown-option-container">
                        <div className="dropdown-option">
                            <p className="dropdown-option-text">Test1</p>
                        </div>
                        <div className="dropdown-option">
                            <p className="dropdown-option-text">Test2</p>
                        </div>
                        <div className="dropdown-option">
                            <p className="dropdown-option-text">Test3 uzun test</p>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
